@font-face {
  font-family: "Roboto";
  src: url("../fonts/Roboto-Regular-webfont.woff") format("woff");
  font-weight: normal;
  font-style: normal;
}

sources.styles\\_reset.scss:
h1,
h2,
h3,
h4,
li,
ul,
div,
header,
footer,
main,
article,
a,
img,
p,
button,
input {
  margin: 0;
  padding: 0;
  list-style-type: none;
  font-family: Roboto, arial, sans-serif;
  font-size: 16px;
  text-decoration: none;
}

sources.styles\\content-contein.scss:
.container-for-content {
  @media (max-width:$mobile-size-breackpoint) {
    padding: 0 20px;
    margin: 0 auto;
  }

  padding: 0 $padding-for-main-content;
  margin: 0 auto;

  @media (min-width:$mobile-size-breackpoint
