sources.styles\\small-header.scss:
.small-header {
  display: none;
}

@media (max-width:$mobile-size-breackpoint) {
  .small-header {
    position: fixed;
    top: 0;
    left: 100%;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    width: 100%;
    height: 100vh;
    box-sizing: border-box;
    padding: 25px 20px 20px;
    background-color: #0075ff;
    transition: transform 0.3s linear;

    &__label-for-menu {
      position: absolute;
      right: 25px;
      width: 16px;
      height: 16px;
      padding-top: 30px;
      background: url(../images/close_menu.svg) no-repeat center;
    }
  }

  .header__menu-button:checked ~ .small-header {
    transform: translateX(-100%);

  }
}

.small-nav {
  &__item {
    margin-top: 32px;
  }

  &__link {
    font-weight: bold;
    font-size: 22px;
    line-height: 22px;
    letter-spacing: 2px;
    text-transform: uppercase;
    color: $wite-color;
  }

  &__phone,
  &__phone + &__link {
    color: $wite-color;
    font-size: 12px;
    line-height: 16px;
    letter-spacing: $link-letter-spacing;
  }

  &__phone + &__link {
    padding-bottom: 8px;
    border-bottom: 1px solid;
    width: fit-content;
    margin-bottom: 30px;
  }
}

sources.styles\\about-us.scss:
.about-us {
  display: grid;
  grid-template-columns: 1fr 1fr;
  padding-top: 104px;

  &__header {
    font-weight: bold;
    font-size: 48px;
    line-height: 48px;
    letter-spacing: -1.5px;
  }

  &__header-blue-word {
    color: $blue-text-color;
  }

  &__description-header {
    font-weight: bold;
    font-size: 24px;
    line-height: 30px;
    color: $blue-text-color;
  }

  &__description-main-text {
    max-width: 500px;
  }

  &__text {
    line-height: 27px;
    color: $main-text-color;
  }

  &__bold-text {
    font-weight: bold;
  }
}

@media (max-width:$mobile-size-breackpoint) {

  .about-us {
    grid-template-columns: 1fr;
    padding-top: 60px;

    &__description {
      padding-top: 50px;
    }

    &__description-main-text {
      max-width: none;
    }
  }
}

sources.styles\\gallery.scss:
.gallery {
  &__img {
    border-radius: 8px;
    height: 256px;
    width: 100%;
    object-fit: cover;
    transition: $transfrom-duration;

    @media (max-width:$half-breackpoint) {
      height: 131px;
    }
  }

  &__img:hover {
    transform: $transform-property;
    cursor: pointer;
  }

  &__palm-images {
    display: grid;
    grid-template-columns: 2fr 1fr;
    column-gap: $distance-between-pictures;

    @media (max-width:$mobile-size-breackpoint) {
      grid-template-columns: 1fr 1fr;
    }
  }

  &__residence-images {
    display: grid;
    grid-template-columns: 1fr 1fr;
    column-gap: $distance-between-pictures;

    @media (max-width:$mobile-size-breackpoint) {
      grid-template-columns: 1fr 1fr;
    }
  }

  &__faena-car-images {
    display: grid;
    grid-template-columns: 1fr 2fr;
    column-gap: $distance-between-pictures;

    @media (max-width:$mobile-size-breackpoint) {
      grid-template-columns: 1fr 1fr;
    }
  }

  &__img-description {
    margin-top: 24px;
    margin-bottom: 40px;
    line-height: 27px;
  }

  &__blue-word {
    color: $blue-text-color;
    font-weight: bold;
  }

  &__view-more-pictures-button {
    display: block;
    margin: 0 auto;
    height: 56px;
    width: 100%;
    border: 2px solid $blue-text-color;
    box-sizing: border-box;
    border-radius: $most-used-border-radius;
    color: $blue-text-color;
    font-weight: bold;
    font-size: inherit;
    background-color: inherit;
    outline: none;
    transition: transform 0.2s linear;
    cursor: pointer;
  }

  @media (min-width:$half-breackpoint) {
    &__view-more-pictures-button {
      width: 188px;
    }
    &__view-more-pictures-button:hover {
      box-shadow: 0 15px 20px rgba(4, 0, 157, 0.4);
      transform: scale(1.1);
    }
  }
}

